// firebase.json
{
    "hosting": {
      "public": "out",
      "ignore": [
        "firebase.json",
        "**/.*",
        "**/node_modules/**"
      ],
      "rewrites": [
        {
          "source": "**",
          "destination": "/index.html"
        }
      ]
    },
    "functions": {
      "source": "functions",
      "predeploy": [
        "npm --prefix functions run lint",
        "npm --prefix functions run build"
      ]
    }
  }
  
  // .firebaserc
  {
    "projects": {
      "default": "grad-project-databases"
    }
  }
